
public class swapwotemp2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
int a=100;
int b=200;
System.out.println("before swapping");
System.out.println(a+"\t"+b);
a=b+0;
b=a-100;
System.out.println("after swapping");
System.out.println(a+"\t"+b);
	}

}
